import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// Import Pages
import AuthPage from './pages/AuthPage';
import DiscoverPage from './pages/DiscoverPage';
import OnboardingPage from './pages/OnboardingPage';
import RequestsPage from './pages/RequestsPage'; // <-- Import the new page

// Import Layout and PrivateRoute
import DashboardLayout from './components/DashboardLayout';
import PrivateRoute from './context/PrivateRoute';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Public Route for Login/Register */}
          <Route path="/" element={<AuthPage />} />

          {/* Private Onboarding Route */}
          <Route
            path="/onboarding"
            element={
              <PrivateRoute>
                <OnboardingPage />
              </PrivateRoute>
            }
          />

          {/* --- NESTED DASHBOARD ROUTES --- */}
          <Route
            path="/dashboard"
            element={
              <PrivateRoute>
                <DashboardLayout />
              </PrivateRoute>
            }
          >
            {/* The default child route for "/dashboard" is DiscoverPage */}
            <Route index element={<DiscoverPage />} />
            
            {/* The new route for "/dashboard/requests" */}
            <Route path="requests" element={<RequestsPage />} />
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
